    internal struct KnownAnswerTestCase {
		public readonly int letters;
        public readonly string s;
        public readonly string[] u;
        public readonly int[] k;
		public readonly int[] dist;

        public KnownAnswerTestCase(int letters, string s, string[] u, int[] k, int[] dist) {
			this.letters = letters;
            this.s = s;
            this.u = u;
            this.k = k;
			this.dist = dist;
        }
    }

    [TestFixture]
    public class StringSearchKnownAnswerTests {
		StringSearch ss;

		[SetUp]
		public void CreateStringSearch() {
			ss = new StringSearch();
		}

        /// <summary>
        /// Exercises the dist() method with a simple five-letter alphabet
        /// </summary>
        [Test]
        public void SimpleCharDistTest() {
            Assert.AreEqual(0, ss.computeDist('A', 'A', 5));
            Assert.AreEqual(1, ss.computeDist('A', 'B', 5));
            Assert.AreEqual(2, ss.computeDist('A', 'C', 5));
            Assert.AreEqual(2, ss.computeDist('A', 'D', 5));
            Assert.AreEqual(1, ss.computeDist('A', 'E', 5));

            Assert.AreEqual(0, ss.computeDist('A', 'A', 5));
            Assert.AreEqual(1, ss.computeDist('B', 'A', 5));
            Assert.AreEqual(2, ss.computeDist('C', 'A', 5));
            Assert.AreEqual(2, ss.computeDist('D', 'A', 5));
            Assert.AreEqual(1, ss.computeDist('E', 'A', 5));
        }
        
        /// <summary>A few test cases comparing string distances, lifted from the TopCoder forum
        ///     discussion of this problem.
        /// 
        ///     Confusingly, the 'k' in the sample problems is a somewhat useless parameter from
        ///     the test data generation process, and not a correct answer for the problem.</summary>
		[Test]
		public void SimpleStringDistanceTests() {
            ss.buildDistTable(9);

			Assert.AreEqual(16, 
							ss.stringDist(ss.stringToIntArray("ABI"), 
										  ss.stringToIntArray("EBI"),
										  0));
			Assert.AreEqual(1,
							ss.stringDist(ss.stringToIntArray("ABI"),
										  ss.stringToIntArray("ABA"),
										  0));
		}

        [Test]
        public void CompleteKnownAnswerTests() {
			for (int katIdx = 0; katIdx < KATS.Length; katIdx++) {
				KnownAnswerTestCase kat = KATS[katIdx];

				//Compute the optimal indices for each of the substrings in u,
				//against the test string s
				int[] optimalIndices = ss.search(kat.s,
												 kat.u,
												 kat.letters);
                
				//Check the string distance at the computed optimal distance,
				//and ensure this distance matches the known minimal distance
				for (int idx = 0; idx < optimalIndices.Length; idx++) {

					int optimalIdx = optimalIndices[idx];
					int optimalDist = kat.dist[idx];

                    ss.buildDistTable(kat.letters);
                    
					Assert.AreEqual(optimalDist,
									ss.stringDist(ss.stringToIntArray(kat.s),
											ss.stringToIntArray(kat.u[idx]),
											optimalIdx),
									"Incorrect optimal index computed for test case {0}, u[{1}]",
									katIdx,
									idx);
				}
			}
        }

